                if($winner_index !== NULL){
                    $errorDeg = (90 + (360 / count($items) / 2));
                    $minDeg = $errorDeg - ($winner_index * 360 / count($items)) + 360;
                    $maxDeg = $errorDeg - (($winner_index + 1) * 360 / count($items)) + 360;
                    $min = min($minDeg, $maxDeg)+1;
                    $max = max($minDeg, $maxDeg)-1;
                }

            ?>
