    <script>
        window.addEventListener('DOMContentLoaded', function() {
            let wheelItems = <?php echo json_encode($items);?>;
            

            function wheelOfFortune(selector) {
                const node = document.querySelector(selector);
                const sound = document.getElementById('myAudio')
                if (!node) return;

                const spin = node.querySelector('button');
                const wheel = node.querySelector('ul');
                let animation;
                let previousEndDegree = 0;
                let spinDuration = 6300;

                spin.addEventListener('click', () => {
                    spin.disabled = true;
                    let total = <?php echo count($items); ?>;
                    sound.pause();
                    sound.currentTime = 0;
                    sound.play();

                    if (animation) {
                        animation.cancel(); // Reset the animation if it already exists
                    }
                    const randomAdditionalDegrees = Math.random() * 360 + 3600;
                    let newEndDegree;
                    <?php if($winner_index !== NULL): ?>
                    newEndDegree = previousEndDegree + (Math.floor(Math.random() * (<?php echo $max;?> - <?php echo $min;?> + 1) + <?php echo $min;?>) + 3600) - (previousEndDegree%360);
                    <?php else: ?>
                    newEndDegree = previousEndDegree + randomAdditionalDegrees;
                    <?php endif; ?>
                    const spinDegError = 90 + (360 / total) / 2;
                    resultIndex = Math.floor(total - ((newEndDegree - spinDegError) % 360) / (360 / total));
                    animation = wheel.animate([{
                            transform: `rotate(${previousEndDegree}deg)`
                        },
                        {
                            transform: `rotate(${newEndDegree}deg)`
                        }
                    ], {
                        duration: spinDuration,
                        direction: 'normal',
                        easing: 'cubic-bezier(0.65, 1, 0.86, 1)',
                        fill: 'forwards',
                        iterations: 1
                    });
                    setTimeout(function() {
                        show_winner(resultIndex);
                        spin.disabled = false;
                    }, spinDuration);
                    previousEndDegree = newEndDegree;
                });

                function show_winner(id) {
                    $('#winner-box').css('color', wheelItems[id].color).html(wheelItems[id].name)
                    let formdata = new FormData();
                    formdata.append('id', <?php echo $wheel_id;?>);
                    formdata.append('result', wheelItems[id].name);
                    $.ajax({
                        url: 'script/result.php',
                        method: 'post',
                        data: formdata,
                        processData: false,
                        contentType: false
                    });
                }
            }

            // Usage
            wheelOfFortune('.ui-wheel-of-fortune');

            $('#wheel_id').change((event) => {
                location.href = 'spinner.php?id=' +event.target.value;
            });

            $('#speaker').click(()=>{
                const sound = document.getElementById('myAudio');
                sound.volume = sound.volume === 1 ? 0 : 1;
                $('#speaker i.fas').addClass(sound.volume === 1 ? 'fa-volume-up' : 'fa-volume-down').removeClass(sound.volume === 0 ? 'fa-volume-up' : 'fa-volume-down')
            })
        });
    </script>
